import React from 'react';

function ApiTest(){

    fetch('http://localhost:3000/api/test', {
        headers: {
            'Accept': 'application/json'
        }
    })
        .then(res => {
            if (res.ok){
                console.log(res)
            }
            else{
                console.log("BAD")
            }
        })

    return <p>test</p>
}

export default ApiTest
